import React, { useEffect, useState } from 'react';
import { ScatterChart, Scatter, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const GlobalStats = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('https://read-racer.azurewebsites.net/api/getGlobalStats')
      .then((res) => res.json())
      .then((json) => {
        // Optional: filter out extreme or likely invalid results
        const filter = (attempts) =>
          attempts.filter(
            (a) => a.readingSpeed > 30 && a.readingSpeed < 2000 && a.accuracy >= 0 && a.accuracy <= 1
          );

        setData({
          summary: filter(json.summaryAttempts || []),
          passage: filter(json.passageAttempts || []),
          summaryAvg: json.summaryAvg,
          passageAvg: json.passageAvg,
          leaderboard: json.leaderboard || [],
        });
        setLoading(false);
      })
      .catch((err) => {
        console.error('Failed to fetch global stats:', err);
        setError('Failed to load data');
        setLoading(false);
      });
  }, []);

  if (loading) return <div className="text-center p-6">Loading global stats...</div>;
  if (error) return <div className="text-center p-6 text-red-500">{error}</div>;

  return (
    <div className="p-6 max-w-4xl mx-auto space-y-8">
      <h2 className="text-3xl font-bold text-center">Global Experiment Stats</h2>

      <div>
        <h3 className="text-xl font-semibold mb-2 text-blue-700">Reading Speed vs Accuracy (AI Summary Group)</h3>
        <ResponsiveContainer width="100%" height={300}>
          <ScatterChart>
            <CartesianGrid />
            <XAxis type="number" dataKey="readingSpeed" name="Speed" unit="WPM" />
            <YAxis type="number" dataKey="accuracy" name="Accuracy" domain={[0, 1]} />
            <Tooltip cursor={{ strokeDasharray: '3 3' }} />
            <Legend />
            <Scatter name="Participants" data={data.summary} fill="#8884d8" />
            <Scatter
              name="Global Avg"
              data={[{ readingSpeed: data.summaryAvg.readingSpeed, accuracy: data.summaryAvg.accuracy }]}
              fill="#ff7300"
              shape="star"
            />
          </ScatterChart>
        </ResponsiveContainer>
      </div>

      <div>
        <h3 className="text-xl font-semibold mb-2 text-green-700">Reading Speed vs Accuracy (Full Passage Group)</h3>
        <ResponsiveContainer width="100%" height={300}>
          <ScatterChart>
            <CartesianGrid />
            <XAxis type="number" dataKey="readingSpeed" name="Speed" unit="WPM" />
            <YAxis type="number" dataKey="accuracy" name="Accuracy" domain={[0, 1]} />
            <Tooltip cursor={{ strokeDasharray: '3 3' }} />
            <Legend />
            <Scatter name="Participants" data={data.passage} fill="#82ca9d" />
            <Scatter
              name="Global Avg"
              data={[{ readingSpeed: data.passageAvg.readingSpeed, accuracy: data.passageAvg.accuracy }]}
              fill="#ff7300"
              shape="star"
            />
          </ScatterChart>
        </ResponsiveContainer>
      </div>

      <div>
        <h3 className="text-xl font-semibold mb-3">Leaderboard (Top 10 by Points)</h3>
        <table className="w-full border rounded-xl overflow-hidden text-left">
          <thead className="bg-gray-100">
            <tr>
              <th className="py-2 px-4">Rank</th>
              <th className="py-2 px-4">User</th>
              <th className="py-2 px-4">Points</th>
              <th className="py-2 px-4">Speed (WPM)</th>
              <th className="py-2 px-4">Accuracy</th>
            </tr>
          </thead>
<tbody>
  {data.leaderboard.map((entry, index) => (
    <tr key={index} className="border-t">
      <td className="py-2 px-4 font-bold">#{index + 1}</td>
      <td className="py-2 px-4 font-mono text-sm">
        {entry.userName || 'Anonymous'}
      </td>
      <td className="py-2 px-4">{entry.points.toFixed(2)}</td>
      <td className="py-2 px-4">{Math.round(entry.readingSpeed)}</td>
      <td className="py-2 px-4">{(entry.accuracy * 100).toFixed(1)}%</td>
    </tr>
  ))}
</tbody>
        </table>
      </div>
    </div>
  );
};

export default GlobalStats;
